import { useNewEmailSubscription, useRequestAuthEmailMutation } from "../generated/graphql";

export default () => {
    const { data, loading } = useNewEmailSubscription();
    const requestAuthEmail = useRequestAuthEmailMutation({
        variables: {
            email: "jahun135@hanmail.net",
            message: "야야야",
        }
    });
    const onClick = async() => {
        await requestAuthEmail;
    }
    console.log('data', JSON.stringify(data));
    console.log('loading', loading);
    return (
        <div>
            { data && JSON.stringify( data ) }
            <button onClick={ onClick }>버튼</button>
        </div>

    );
};
